import "../boostrap/boostrap.css";
import "../../node_modules/bootstrap/dist/js/bootstrap.bundle";
import "./css/Gallery.css";

const images = (props) => {
  return (
    <li>
      <div>
        <img src=""></img>
        <h2> Event Bornto Protect {props} </h2>
        <p>I was nominated for 100 borntoprotect people</p>
      </div>
    </li>
  );
};

const Gallery = () => {
  var image = new Map();
  for (let i = 0; i < 5; i++) {
    image.set([i], `${[i]}`);
  }
  return (
    <div>
      <h1 className="gl_h1">My Gallery</h1>
      <ul className="gl_cont_ul">
        {image.map(() => {
          <li className="gl_element_li"></li>;
        })}
      </ul>
    </div>
  );
};

export default Gallery;
